import React from 'react';

class App extends React.Component{
    constructor(){
        super();
        this.state ={
            nilai1 : 1,
            nilai2 : 2,
            hasil :0
        }
    }
    render(){
        return(
            <div>
                Welcome to React
                <p>{this.state.nilai1}</p>
               <p>{this.state.nilai2}</p>
               <p>{this.state.hasil}</p> 
            </div>
        )
    }
}
export default App;
